import {
  LOADING_PROFILE,
  PROFILE_SUCCESS,
  PROFILE_ERROR
} from '../actions/profile';

export default function reducer(statePart = [], action = {}) {
  switch (action.type) {
    case LOADING_PROFILE:
      return{
        ...statePart,
        isFetching: true
      }
    case PROFILE_SUCCESS:
      return{
        ...statePart,
        data: action.payload,
        isFetching: false
      }
    case PROFILE_SUCCESS:
      return{
        ...statePart,
        data: action.payload,
        isFetching: false
      }
    default:
      return statePart;
  }
}
